using System;
using Xunit;

namespace Structurizr.Core.Tests.View
{
    public class BrandingTests
    {
        [Fact]
        public void Test_SetLogo_WithAUrl()
        {
            var branding = new Branding();
            branding.Logo = "https://structurizr.com/static/img/structurizr-logo.png";
            Assert.Equal("https://structurizr.com/static/img/structurizr-logo.png", branding.Logo);
        }

        [Fact]
        public void Test_SetLogo_WithAUrlThatHasATrailingSpaceCharacter()
        {
            var branding = new Branding();
            branding.Logo = "https://structurizr.com/static/img/structurizr-logo.png ";
            Assert.Equal("https://structurizr.com/static/img/structurizr-logo.png", branding.Logo);
        }

        [Fact]
        public void Test_SetLogo_WithADataUri()
        {
            var branding = new Branding();
            branding.Logo =
                "data:image/png;base64,";
            Assert.Equal(
                "data:image/png;base64,",
                branding.Logo);
        }

        [Fact]
        public void Test_SetLogo_ThrowsAnIllegalArgumentException_WhenAnInvalidUrlIsSpecified()
        {
            var branding = new Branding();
            Assert.Throws<ArgumentException>(() =>
                branding.Logo = "blah"
            );
        }

        [Fact]
        public void Test_SetLogo_DoesNothing_WhenANullUrlIsSpecified()
        {
            var branding = new Branding();
            branding.Logo = null;
            Assert.Null(branding.Logo);
        }

        [Fact]
        public void Test_SetLogo_DoesNothing_WhenAnEmptyUrlIsSpecified()
        {
            var branding = new Branding();
            branding.Logo = " ";
            Assert.Null(branding.Logo);
        }
    }
}